import React from "react";
import "./Navbar.css";

const Navbar = props => {
return (
    <div>
        <ul className="nav nav-bar">
        <li><a href="/">Clicky Game</a></li>
       <li
       className={props.message.indexOf('incorrectly') !== -1 ?
       "desc-incorrect" :
       props.message.indexOf('correctly')
    }
       ></li>
        </ul>

    </div>
    )
}
export default Navbar;
